using System;

namespace Advent2018.Day5
{
    class Program
    {
        #region
        private static string input = @"";
        #endregion
        static void Main(string[] args)
        {
            // Part1();

            Part2();
        }

        private static void Part1()
        {
            var result = ReactPolymer(input);

            Console.WriteLine(result.Length);
        }

        private static void Part2()
        {
            var letters = "abcdefghijklmnopqrstuvwxyz";

            var shortest = int.MaxValue;

            foreach (var l in letters)
            {
                var cleaned = input.Replace(l.ToString(), string.Empty).Replace(char.ToUpper(l).ToString(), string.Empty);
                var result = ReactPolymer(cleaned);

                if (result.Length < shortest)
                {
                    shortest = result.Length;
                }
            }

            Console.WriteLine(shortest);
        }

        private static string ReactPolymer(string input)
        {
            for (var i = 1; i < input.Length; ++i)
            {
                var prev = input[i - 1];
                if (IsMatch(prev, input[i]))
                {
                    input = input.Substring(0, i - 1) + input.Substring(i + 1);
                    i = Math.Max(0, i - 2);
                }
            }

            return input;
        }

        private static bool IsMatch(char left, char right)
        {
            return left != right && char.ToLower(left) == char.ToLower(right);
        }
    }
}
